// SPDX-License-Identifier: UNLICENSED
pragma solidity 0.8.24;

import {PriceConverter} from "./PriceConverter.sol";

// const, immutable(cost less gas)

error NotOwner();// gas efficient

contract FundMe{
    using PriceConverter for uint256;

    uint256 public minUsd = 5e18;

    address[] public funders;
    mapping (address funder => uint256 amountFunded) public  addressToAmountFunded;

    address public immutable i_owner;

    constructor() {
        i_owner = msg.sender;
    }

    function fund() public payable {
        require(msg.value.getConversionRate() >= minUsd, "Eth sent is too low" );   
        funders.push(msg.sender); 
        addressToAmountFunded[msg.sender] = addressToAmountFunded[msg.sender] + msg.value;
    }

    // function getVersion() public view returns (uint256) {
    //     return AggregatorV3Interface(0x694AA1769357215DE4FAC081bf1f309aDC325306).version();
    // }


    function withdraw() public onlyOwner {
        // require(msg.sender == owner, "Must be owner!");

        for(uint256 funderIndex = 0; funderIndex < funders.length; funderIndex++){
            address funder = funders[funderIndex];
            addressToAmountFunded[funder] = 0;
        }
        // //transfer
        // payable(msg.sender).transfer(address(this).balance);

        // //send
        // bool sendSuccess = payable (msg.sender).send(address(this).balance);
        // require(sendSuccess, "Send Failed");

        //call
        (bool callSuccess,  ) = payable(msg.sender).call{value: address(this).balance  }("");
        require(callSuccess, "Call failed");
    }

    modifier  onlyOwner(){
        // require(msg.sender == i_owner, "Must be ow ner!");
        if(msg.sender != i_owner){ revert NotOwner();}
        _;// execute any other code after validation
    }

    receive() external payable { 
        fund();
    }

    fallback() external payable { 
        fund();
    }
}

PriceConverter.sol.content:
// SPDX-License-Identifier: UNLICENSED
pragma solidity 0.8.24;

import {AggregatorV3Interface} from "@chainlink/contracts@1.3.0/src/v0.8/shared/interfaces/AggregatorV3Interface.sol";

library PriceConverter {
    
   function getPrice() internal view returns (uint256) {
        AggregatorV3Interface priceFeed = AggregatorV3Interface(0x694AA1769357215DE4FAC081bf1f309aDC325306);
        (, int256 answer,,,) = priceFeed.latestRoundData();

        return uint256(answer) * 1e10;
    }

    function getConversionRate(uint256 ethAmount) internal view returns (uint256) {  
        uint256 ethPrice = getPrice();
        uint256 ethAmountInUsd = (ethPrice * ethAmount)/ 1e18;
        return ethAmountInUsd;
    }
}

